In C++, `std::floor()` is a function that returns the largest integer value that is less than or equal to a given number. It essentially "rounds down" the input value to the nearest whole number.

It's part of the `<cmath>` library and takes one argument, which can be any type that can be converted to a floating-point number (such as `float`, `double`, or `long double`).

Here's an example usage:
```c
#include <iostream>
#include <cmath>

int main() {
    double x = 4.7;
    int result = std::floor(x);
    std::cout << result << std::endl; // Outputs: 4

    return 0;
}
```
Note that `std::floor()` does not modify the original value; it simply returns the floored value. Also, if you pass an already-integer value to `std::floor()`, the function will just return that same integer value.

The counterpart to `std::floor()` is `std::ceil()`, which rounds up to the nearest whole number.

